        "publishedAt": "2022-08-31T14:00:08Z",
        "channelId": "UCHRvowaJNUxw9_HIFY6NYdw",
        "title": "Fettes Brot - Brot weint nicht (Official)",
        "description": "VIDEO: Oliver Tietgen / Boesewicht Film\n\nMoin-moin, was geht? Es gibt Nachrichten: Mehrere gute und eine heftige vorweg:\nFettes Brot ... is history!\n\nFast 30 wird unsere kleine Combo aus dem Hamburger Baumschulgebiet dieses Jahr. Nicht schlecht fr drei Vorstadtkrokodile, die auf ihrer ersten ECHO-Verleihung 1995 als gekrte Frischlinge des Jahres das nichtsahnende Publikum direkt mit einem internen Battlerap verwirrten: \"3 sind 2 zuviel\". Rckblickend eine sich-selbst-erfllende Prophezeiung auf Nostradamus-Level. Omins! Sicher ist natrlich nur: Jubilen waren uns immer schon schnurzpiepegal. Und dreimal solange durchzuhalten wie die Beatles, ist fr uns noch keine Kunst. Bevor wir also bald unsere eigenen Wachsfiguren bei Madame T einweihen drfen, schaufeln wir ewigen Teenager uns mit \"fast 50\" lieber unser eigenes Grab. Richtig gelesen: Gruppe Fettes Brot is nicht nur ancient ... sondern HISTORY! Papa und Papa und Papa trennen sich. Ende '23 packen wir unsere Turnbeutel und wandern ab da auf neuen Wegen. \n\nAber was war das bitte fr ein Reise? Solange \"the music\" unsere gemeinsame Nr. 1 war, vergingen die Jahre wie im Flug. Als Kinder der 80er waren Run DMC uns immer genauso teuer wie Die rzte, haben De La Soul unser Boot so heftig gerockt wie Rio Reiser. Als wir anfingen, rappten kaum Menschen in der hiesigen Muttersprache, ausser Advanced Chemistry und Fanta 4. Bequem setzen wir uns zwischen deren Sthle und droppten ber die Jahre ein paar Evergreens wie \"Jein\", \"Bettina\" und \"Emanuela\", \"Schwule Mdchen\" oder \"An Tagen wie diesen\". Und die Generation MTViva guckte uns beim Growerden zu. \n\nAnno 2022 erscheint uns unsere gemeinsame Story irgendwie auserzhlt. (Auch, wenn Peter Jackson das wohl anders she). Aber klaro: Ehrensache, dass unsere gemeinsame Epoche mit einem Knallerfinale enden muss. Weil Brot nicht (lange) weint, stellt ihr euch bitte eins von diesen berbordenden New Orleans-Begrbnissen vor, wo alle 10 Minuten heulen und schluchzen und dann 10 Stunden eine lachende Lokomotive aus Menschen und Musik durch die Strassen der Stadt schnauft! \n\nWir laden euch also hiermit zu verrckten, finalen Festspielen ein. Es kommen auf euch zu: \n- eine Abschiedstour (FB ... is history!) und \n- unsere erste Greatest Hits-Platte (Hitstory), \n- Music Music Music \n- viele Surprises von unserer ewigen Bucketlist: Sachen, die wir immer schon mal machen wollten, wie die Hamburger Hafenkonzert-Safari letzten Freitag (#FettesBoot).\n\nDas Museum Fettes Brot bleibt natrlich fr immer immer geffnet. Wir mchten, dass ihr allzeit unsere Fans bleibt. Unser schner Katalog an Alben seit 1994 wird weiterhin aufgerscht mit Extras und Bonssen und wie neu erscheinen (nchste Reissue-Runde ab Herbst: \"Gebck to the future 2001 - 2010\").\n\nWer hiervon nix verpassen will, also ultra-exklusive Tour-Tickets, Platten, CDs, T-Shirts, Bcher, Bundles und sonst noch alles braucht, besucht ab 02.09.2022 unseren Bandstore unter www.fettesbrotshop.de \n\nWir sehen uns noch. \nTschssikowski hardcore,\nFB\n\nFettes Brot ... is history Tour\n\n05.04.2023  ROSTOCK - STADTHALLE \n06.04.2023  DORTMUND - WESTFALENHALLE\n08.04.2023  BREMEN - HALLE 7\n09.04.2023  OFFENBACH - STADTHALLE\n10.04.2023  LEIPZIG - HAUS AUENSEE\n13.04.2023  AT-WIEN - GASOMETER\n14.04.2023  ERLANGEN - HEINRICH - LADES - HALLE\n15.04.2023  BIELEFELD - SEIDENSTICKERHALLE\n26.04.2023  CH-ZRICH - KOMPLEX 457\n27.04.2023  KLN - LANXESS ARENA\n28.04.2023  BERLIN - MAX SCHMELING HALLE\n01.05.2023  MNCHEN - ZENITH\n02.05.2023  STUTTGART - PORSCHE-ARENA\n04.05.2023  HANNOVER - SWISS LIFE HALL\n05.05.2023  MNSTER - MCC HALLE MNSTERLAND\n06.05.2023  KIEL - WUNDERINO ARENA\n\nTickets ab 02.09.2022 / 10 Uhr nur auf www.fettesbrotshop.de   \n\n#fettesbrot #history #hitstory #hiphop #rap #pop #neuemusik #tour #schwulemdchen",
