          "title": "Wie man traditionell vom Baum zum Brett kommt | SWR Handwerkskunst",
          "description": "Eine 30 Meter hohe Esche im Westerwald. Wie hat man frher, als es noch keine Maschinen gab, einen solchen Baum gefllt und weiterverarbeitet? \n\nZwei Mnner aus Hrtlingen bei Westerburg wissen noch, wie das ging: Mathias Glser und Jan Vockel. Die beiden sind Zimmerermeister und geprfte Restauratoren im Handwerk. Sie fllen die Esche mit xten und zersgen dann den Stamm. Danach zeigen sie alte Techniken, wie aus dem Rundholz ein mglichst groer eckiger Balken wird. Sie bringen den Stamm auf einen Bock und \"bebeilen\" ihn dort. Frher brauchte ein gebter Hauer nur sechs Minuten, um einen Meter des Stammes eckig zu bebeilen. Unsere beiden Protagonisten brauchen zwar etwas lnger, aber das Ergebnis berzeugt: ein akkurater Balken, aus dem sie dann Bretter schneiden.\n\nDie \"Handwerkskunst\" zeigt die traditionelle Bearbeitung von Holz. Eine Arbeit, die anstrengend und schweitreibend ist.\n\nIM VIDEO\nMathias Glser, Zimmerermeister und Restaurator im Handwerk\nJan Vockel, Zimmermann\n\nCREDITS\nAutor: Wolfgang Drr\nKamera: Daniel Mesenholl\nSchnitt: Lodur Tettenborn \nRedaktion: Rolf Hffer\nSocial Media Redaktion: Land und Leute RP Online\n\nWir freuen uns auf deine Meinung zum Film in den Kommentaren und nicht vergessen: Handwerkskunst abonnieren! - https://www.youtube.com/c/handwerkskunst?sub_confirmation=1\n\nIn \"Handwerkskunst\" wird in jedem Film ein Handwerk vorgestellt - vom ersten Arbeitsschritt bis zur Vollendung. Mit langen Einstellungen, genauen Beobachtungen, ruhigen Schnittfolgen und ohne strende Hintergrundmusik kann jeder nachvollziehen, wie die Dinge entstehen und begreifen, warum gutes Handwerk auch groe Kunst ist.\n\nNetiquette:\nhttps://www.swr.de/netiquette\n\n#Handwerkskunst #Brett #Baum"
